import BodyText from '@enact/sandstone/BodyText';
import {Panels, Panel, Header} from '@enact/sandstone/Panels';
import { ThemeDecorator } from '@enact/sandstone/ThemeDecorator';
import './Live.css';

const Live = (props) => {

  return (
    <Panels style={{height: "100%",}}>
      <Panel {...props} style={{height: "100%"}}>
        <Header id="Header" title="[슈펜] 겨울 필수템 퍼슈즈/패딩화/롱부츠 특가전" subtitle="LIVE: 86,103" style={{fontSize:"0.5rem",}}/>
        <BodyText>test</BodyText>
      </Panel>
    </Panels>
  );
};

export default ThemeDecorator(Live);
